    console.log('get initial props')
    return {
      user: {
        name: 'Francis'
      }
    }
  }
  constructor() {
    super()
    console.log('constructor');
  }
  render() {
    console.log('render');
    return (
      <>
        <MainLayout>
          <h1>Welcome to NextJS</h1>
        </MainLayout>
      </>
    );
  }
}
